import Iframe from 'react-iframe';
import './App.css';

function NetdataElement() {
  var netdata_iframe = <Iframe url="https://netdata.tylerharrison.dev/"
  width="99%"
  // height="100vh"
  id="netdata"
  className="netdata"
  display="block"
  object-fit="contain"
  // position="relative"
  frameBorder="0"/>
  return netdata_iframe;
}

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
      </header>
    <NetdataElement />
    </div>
  );
}


export default App;
